import React, {Component} from 'react';
import ResponsiveMenu from 'react-responsive-navbar';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="Nav-Bar">
        <a>Work</a>
      </header>
    </div>
  );
}

class NavBar extends Component {
  render() {
    return (
      <ResponsiveMenu
        menuOpenButton={<div />}
        menuCloseButton={<div />}
        changeMenuOn="500px"
        largeMenuClassName="large-menu-classname"
        smallMenuClassName="small-menu-classname"
        menu={
          <ul>
            <li>Work</li>
            <li>UI Design</li>
            <li>Visual Design</li>
            <li>About me</li>
          </ul>
        }
      />
    );
  }
}

export default App;
